import React from "react";
import "./Search.css";
import SearchIcon from "@mui/icons-material/Search";
import MicIcon from "@mui/icons-material/Mic";
// import { Button } from "@mui/material";
import imageIcon from './image/image_icon.png'

const Search = () => {
  return (
    <div className="search">
      <div className="search_input">
        <SearchIcon className="search_inputIcon" />
        <input placeholder="Search anything" />
        <MicIcon />
      </div>
      <div className="shortMenu">
        <a href="/Image">
          <img src= {imageIcon} alt="Images" />
          <span>Images</span>
        </a>
        <a href="/News">
          <img src="image/news_icon.png" alt="News" />
          <span>News</span>
        </a>
        <a href="/Social">
          <img src="image/social-icon.png" alt="Social" />
          <span>Social</span>
        </a>
        <a href="/Video">
          <img src="image/video_icon.png" alt="Shopping" />
          <span>Video</span>
        </a>
      </div>
    </div>
  );
};

export default Search;
